--
-- Table structure for table `listing`
--

DROP TABLE IF EXISTS `listing`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `listing` (
  `listid` int NOT NULL COMMENT 'Clave primaria, un valor de ID único para cada fila. Cada fila representa la lista de un lote de tickets para un evento específico.',
  `sellerid` int DEFAULT NULL COMMENT 'Referencia de clave externa a la tabla USERS, que identifica al usuario que vende los tickets.',
  `eventid` int DEFAULT NULL COMMENT 'Referencia de clave externa a la tabla EVENT.',
  `dateid` smallint DEFAULT NULL COMMENT 'Referencia de clave externa a la tabla DATE.',
  `numtickets` smallint DEFAULT NULL COMMENT 'Cantidad de tickets disponibles para la venta.',
  `priceperticket` decimal(8,2) DEFAULT NULL COMMENT 'Precio fijo de una entrada individual',
  `totalprice` decimal(8,2) DEFAULT NULL COMMENT 'El precio total para un listado en particular (NUMTICKETS*PRICEPERTICKET)',
  `listtime` timestamp NULL DEFAULT NULL COMMENT 'Fecha y hora sin abreviar en que se publicó el listado, ejemplo: 2008-03-18 07:19:35.',
  PRIMARY KEY (`listid`),
  KEY `idx_dateidlisting` (`dateid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

